import React from 'react';

const Atletas = () => {
  // Exemplo de como a lista vai aparecer com as novas categorias
  const listaExemplo = [
    { id: 1, nome: 'Jorge Schell', categoria: 'Masculino A', ranking: 1 },
    { id: 2, nome: 'Ana Sand', categoria: 'Feminino B', ranking: 3 },
    { id: 3, nome: 'Lucas Kids', categoria: 'Sub-14', ranking: 10 }
  ];

  return (
    <div style={{ padding: '10px' }}>
      <table style={{ width: '100%', borderCollapse: 'collapse' }}>
        <thead>
          <tr style={{ backgroundColor: '#f8f9fa', textAlign: 'left' }}>
            <th style={{ padding: '12px', borderBottom: '2px solid #dee2e6' }}>Atleta</th>
            <th style={{ padding: '12px', borderBottom: '2px solid #dee2e6' }}>Categoria Oficial</th>
            <th style={{ padding: '12px', borderBottom: '2px solid #dee2e6' }}>Ranking</th>
          </tr>
        </thead>
        <tbody>
          {listaExemplo.map(atleta => (
            <tr key={atleta.id} style={{ borderBottom: '1px solid #eee' }}>
              <td style={{ padding: '12px', fontWeight: '500' }}>{atleta.nome}</td>
              <td style={{ padding: '12px' }}>
                <span style={{ background: '#e9ecef', padding: '4px 8px', borderRadius: '12px', fontSize: '12px' }}>
                  {atleta.categoria}
                </span>
              </td>
              <td style={{ padding: '12px' }}>{atleta.ranking}ยบ lugar</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default Atletas;
